import Head from 'next/head';
import styles from '../styles/Home.module.css';
import styled from "@emotion/styled";

const Heading = styled.h1`
    color: red;
`;

export default function Home() {
  return (
    <div>
      <Heading>Inicio</Heading>

    </div>
  )
}
